import React from 'react';
import Flight from '../Search/flight.js'
import Hotel from '../Search/hotel.js'
import Car from '../Search/car.js'

class MainTabContent extends React.Component{
  render() {
    return (
      <div className="tab-content">
        <div className="tab-pane active"><Flight /></div>
        <div className="tab-pane "><Hotel /></div>
        <div className="tab-pane "><Car /></div>
      </div>
    )
  }
}
export default MainTabContent
